const AboutMe = () => {
    const[name, seName] = useState('');

    const toggleName = () => {
        SetName("Bret Patterson");
    };

    return(
    <div className="about-me">
        <h1>hi, my name is</h1>
        <h4>{name}</h4>

        <button onClick={toggleName}>See my name</button>
    </div>
    );
};

export default AboutMe;
